// Import image
import sensor_icon from "../icons/sensor.png";
import camera_trap_icon from "../icons/camera_trap.png";

const SENSORS = [
    {"type": "Ground Water Level", "latitude":51.5094, "longitude":-2.5890, "id": 1, "icon": sensor_icon},
    {"type": "Live Camera","latitude":51.5100,"longitude":-2.5957, "id": 2, "icon": sensor_icon},
    {"type": "Camera Trap","latitude":51.5110,"longitude":-2.5917, "id": 1, "icon": camera_trap_icon},
    {"type": "Noise Sensor","latitude":51.5110,"longitude":-2.5917, "id": 1, "icon": camera_trap_icon}
];

export default SENSORS;
